import './user.css';
import React from 'react';
import {useState, useEffect} from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faHouse,
  faArrowsLeftRight,
  faSearch,
  faCalendar,
  faA,
  faPlus,
  faEnvelope,
  faUser,

} from '@fortawesome/free-solid-svg-icons';
import logo from "./IMG/Logo.jpg"

var open = false

function Dashboard() {
    return(
        <>
            <div className='sidebar' id="mysidebar">
                <div className="top">
                    <div className='a'>
                        <FontAwesomeIcon icon={faHouse} /> <a className="text"> Dashboard</a>
                    </div>
                    <div className='a'>
                        <FontAwesomeIcon icon={faCalendar} /> <a className="text"> Calendar</a>
                    </div>
                    <div className='a'>
                        <FontAwesomeIcon icon={faA} /><FontAwesomeIcon icon={faPlus} /> <a className="text"> Grades</a>
                    </div>
                    <div className='a'>
                        <FontAwesomeIcon icon={faEnvelope} /> <a className="text"> Inbox</a>
                    </div>

                </div>
                <div className="bottom" id="bottom">
                    <FontAwesomeIcon icon={faArrowsLeftRight} className="arrow" onClick={openClose}/>
                </div>
            </div>

            <div className="topbar">
                <div className="left">
                    <img src={logo} alt="Logo" className='logo' />
                </div>
                <div className="right">
                    <div className='search'>
                        <FontAwesomeIcon icon={faSearch} className="searchIcon" />
                        <input className='input' placeholder='Search'></input>
                    </div>

                    <div className="user">
                        <FontAwesomeIcon icon={faUser} className="userLogo" />
                    </div>
                </div>
            </div> 

            <div id="main">

            </div>
        </>
    )
}


function openClose() {
    if( open === false){
        document.getElementById("mysidebar").style.width = "75px";
        document.getElementById("main").style.marginLeft = "75px";
        document.querySelectorAll(".text").forEach(element =>{
            element.innerHTML = ""
        })
        open = true
    } else if (open === true) {
        document.getElementById("mysidebar").style.width = "200px";
        document.getElementById("main").style.marginLeft = "200px";
        var run = 1
        delay(1000).then(() =>
            document.querySelectorAll(".text").forEach(element =>{

                if(run === 1){
                    element.innerHTML = " Dashboard"
                } else if(run === 2){
                    element.innerHTML = " Calendar"
                } else if(run === 3){
                    element.innerHTML = " Grades"
                }else if(run === 4){
                    element.innerHTML = " Inbox"
                }
                run++
            })
        )

        open = false
    }
}

function delay(time) {
    return new Promise(resolve => setTimeout(resolve, time));
}

export default Dashboard;
